import{_ as n,o as r,c as a,z as e,a as t}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 3.2-4121 Virginia Industrial Hemp Fund.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-4121.md","filePath":"vacode/3.2-4121.md"}'),i={name:"vacode/3.2-4121.md"},s=e("h1",{id:"§-3-2-4121-virginia-industrial-hemp-fund",tabindex:"-1"},[t("§ 3.2-4121 Virginia Industrial Hemp Fund. "),e("a",{class:"header-anchor",href:"#§-3-2-4121-virginia-industrial-hemp-fund","aria-label":'Permalink to "§ 3.2-4121 Virginia Industrial Hemp Fund."'},"​")],-1),o=e("p",null,'There is hereby created in the state treasury a special nonreverting fund to be known as the Virginia Industrial Hemp Fund, hereafter referred to as "the Fund." The Fund shall be established on the books of the Comptroller. All moneys levied and collected under the provisions of this chapter shall be paid into the state treasury and credited to the Fund. Interest earned on moneys in the Fund shall remain in the Fund and be credited to it. Any moneys remaining in the Fund, including interest thereon, at the end of each fiscal year shall not revert to the general fund but shall remain in the Fund. Moneys in the Fund shall be used by the Department solely for carrying out the purposes of this chapter. Expenditures and disbursements from the Fund shall be made by the State Treasurer on warrants issued by the Comptroller upon written request signed by the Commissioner.',-1),d=e("p",null,[t("2020, cc. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0659",target:"_blank",rel:"noreferrer"},"659"),t(", "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0660",target:"_blank",rel:"noreferrer"},"660"),t(".")],-1),l=[s,o,d];function h(u,c,p,m,f,g){return r(),a("div",null,l)}const v=n(i,[["render",h]]);export{b as __pageData,v as default};
